package hcl;

public class BinaryOperation {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      Process process=new Process();
      System.out.println(process.addition(20, 4));
      System.out.println(process.subtract(20, 4));
     System.out.println(process.multiply(20, 4));	
     System.out.println(process.divide(20, 4));
      System.out.println(process.remainder(20, 4));
	}

}
